import React from 'react'
import styled from 'styled-components'

const Navbar = styled.div`
    display:block;
    background-color:red;
`
const Container = styled.div`
    text-align:center;
`
export default class Index extends React.Component{
    render(){
        return(
            <Container>
                <Navbar>

                </Navbar>
            </Container>
        )
    }
}
